NOTE: Bij een betaling op de verwerking dag hoeven wij deze controle niet uit te voeren. Betalingsbericht voor SEPA verwerking kan direct aangemaakt en verwerkt worden. Die zal automatisch uitvalllen zoals huidige verwerking.
